CD067: (Conditions) Access to these quotas shall, however, be reserved for products:
- accompanied by a certificate of authenticity recognized by the relevant Community authorities and conforming to one of the models in the annex of  Regulation (EC) nº 32/2000;
- which bear, at the beginning and end of each piece, a stamp approved by the said authorities or, by way of derogation, a seal approved by the authorities of the country of manufacture and fixed to each piece; 
- which are transported directly to the Community from the country of manufacture (Regulation (EC) nº 32/2000, OJ L 5).

